(7, '1467', 'Terrain à batir - BETHISY', 'TERRAIN CONSTRUCTIBLE A VENDRE\nVenez découvrir ce beau terrain à bâtir d\'environ 800m² plat et clôturé, libre de constructeur.\nTout à l’égout, vendu borné avec un certificat d\'urbanisme opérationnel fourni sur demande.\nPetit Village dans lequel vous avez toutes commodités (commerces, écoles, supermarché, etc...) et à 20 minutes de Crépy en Valois, grande ville où toutes les commodités sont présentes : hôpitaux, médecins, écoles (de la maternelle aux études supérieures), activités sportives et culturelles (musée), centre commercial.\nPrix : 75 000 euros direct propriétaire.\nPour visiter Contactez Aurélie au 06.23.75.23.79', 'Aurélie LEPINE', 'aurelie@vendez-votre-maison.fr', '06 23 75 23 79', '60320', 0, '49.298519', '2.802371', 'Bethisy Saint Pierre', '60068', 'FRA', 800, NULL, NULL, NULL, 0, 'V', 'simple', 1, 75000, 'EUR', 1, 61, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1),
(8, '1468', 'Terrain à bâtir - CARLEPONT', 'TERRAIN CONSTRUCTIBLE A VENDRE\nSecteur Ribécourt proche, beau terrain à bâtir de plus 800m² environ, plat et semi clôturé et libre de constructeur !\nVendu borné (plan en téléchargement sur notre site) avec certificat d\'urbanisme opérationnel et permis d\'aménager transmis sur demande.\nLe Village de Carlepont possède des écoles primaires sur place, le collège et les lycées sont situés à 7km\nQuelques commerces présents sur la commune (boulangerie, boucherie) et supermarché à 7km\nVous trouverez la gare de Ribécourt à 10 minutes !\nPrix : 42 000 euros sans frais d\'agence !\nPour visiter contactez au plus vite Aurélie au 06.23.75.23.79', 'Aurélie LEPINE', 'aurelie@vendez-votre-maison.fr', '06 23 75 23 79', '60170', 0, '49.51393', '3.026819', 'Carlepont', '60129', 'FRA', 861, NULL, NULL, NULL, 0, 'V', 'simple', 1, 42000, 'EUR', 1, 61, NULL, NULL, 'https://fichiers.ubiflow.net/18/69/32/66/5/carlepont-plan-de-division.pdf', NULL, NULL, NULL, NULL, 0),
(9, '1502', 'Maison en pierre', 'Maison en pierre à vendre, RIBECOURT - 101m²\nA moins de 30 mn de Compiègne et 10 mn de Ribécourt/Dreslincourt, centre village de Carlepont et commodités, vends maison en pierre à rénover, comprenant entrée, salon, salle à manger, cuisine et arrière cuisine, 1 chambre et salle de bains, wc.\nA l\'étage 2 chambres et grenier aménageable (possible deux chambres supplémentaires).\nL\'ensemble sur un terrain d\'environ 360m².\nDPE vierge\nLe Village de Carlepont possède des écoles primaires sur place, le collège et les lycées sont situés à 7km\nQuelques commerces présents sur la commune (boulangerie, boucherie) et supermarché à 7km\nVous trouverez la gare de Ribécourt à 10 minutes !\nPrix : 129 000 euros\nContactez Aurélie au 06.23.75.23.79 pour une visite !\nUne visite virtuelle est disponible sur notre site.', 'Aurélie LEPINE', 'aurelie@vendez-votre-maison.fr', '06 23 75 23 79', '60170', 0, '49.51393', '3.026819', 'Carlepont', '60129', 'FRA', 101, 7, 3, 101, 1, 'V', 'simple', 1, 129000, 'EUR', 2, 61, NULL, '366', 'https://www.meilleurevisite.com/visit/d27bfff6-2a19-11e9-a6dd-00155d174307', NULL, NULL, NULL, NULL, 0),
(10, '1386', 'Appartement - T3', 'VILLERS COTTERETS - F3 A VENDRE, IDEAL INVESTISSEUR OU PREMIER ACHAT !\nVenez découvrir ce bel appartement de 41 m² en duplex vous offrant salon avec cuisine ouverte équipée, 2 chambres, salle de bains.\nCet appartement se trouve dans une petite copropriété, avec de très faibles charges (environ 150 euros/an)\nLe plus de l\'appartement : une grande cave !\nDPE VIERGE\nCet appartement se situe à VILLERS COTTERETS, commune de l\'Aisne, proche de l\'Oise où vous trouverez centre commercial, médecins, pharmacie, activités sportives et culturelles (musée, château)\nLa gare se trouve à moins de 5 minutes à pieds de l\'appartement et vous permet de regagner Paris (Gare du Nord) en 50 minutes, le centre-ville à moins de 8 minutes à pieds.\nAccès N2 rapide (axe Paris).\nPRIX : 65 000 euros direct propriétaire\nN\'hésitez plus, contactez Alexandre au 06.10.21.66.24 !', 'Alexandre RAMOS', 'alexandre@vendez-votre-maison.fr', '06 10 21 66 24', '02600', 0, '49.255061', '3.0908159', 'Villers Cotterets', '02810', 'FRA', 41, 3, 2, 41, 0, 'V', 'simple', 1, 65000, 'EUR', 19, 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1),
(11, '1495', 'Appartement - T3', 'ST LEU D\'ESSERENT - F3 A VENDRE\nNouveau, à Saint Leu d\'Esserent, situé dans une petite copropriété bénévole, magnifique appartement refait à neuf de 56.4m² situé au RDC d\'une magnifique bâtisse en pierre entièrement restaurée comprenant: belle pièce de vie, couloir desservant 2 jolies chambres ainsi qu\'une salle de bain.\nLe tout avec 2 places de stationnement et un jardinet.\nIdéalement placé dans St leu d\'esserent, tous commerces et gare à pied !\nA visiter sans tarder pour 149 000 euros\nPlus d\'informations en contactant Immo du Thérain au 06 74 49 36 22', 'Immo du Thérain', 'deborah@vendez-votre-maison.fr', '06 74 49 36 22', '60340', 0, '49.218165', '2.41841', 'Saint Leu D Esserent', '60584', 'FRA', 56, 3, 2, 56, 0, 'V', 'simple', 1, 149000, 'EUR', 19, 61, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1),
(12, '1411', 'Appartement - T2', 'ST LEU D\'ESSERENT (60340) - F2 A VENDRE\nNouveau, à Saint-Leu d\'Esserent, en centre-ville, vends magnifique appartement entièrement rénové comprenant: entrée, salle d\'eau avec wc, cuisine aménagée et équipée, belle pièce de vie, 1 chambre spacieuse.\n2 places de stationnement privatives dans une cour intérieure !!\nUn très bel appartement à découvrir pour 149 000euros\nPlus d\'information en contactant l\'agence immobilière Immo du Thérain au 06 74 49 36 22', 'IN VESTISS FRANCE', 'deborah@vendez-votre-maison.fr', '06 74 49 36 22', '60340', 0, '49.218165', '2.41841', 'Saint Leu D Esserent', '60584', 'FRA', 54, 2, 1, 54, 0, 'V', 'simple', 1, 149000, 'EUR', 19, 61, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1),
(13, '1542', 'Appartement - F4', 'ROQUEBRUNE SUR ARGENS (83520) - F4 A VENDRE - 78,36m²\nDans résidence calme avec commerces, appartement en rez-de-jardin au cœur de la Bouverie comprenant entrée, cuisine aménagée et équipée ouverte sur séjour (30 m² env.), salle de bains, WC indépendant, 3 chambres dont une suite parentale avec salle d’eau.\nTerrasse\nSur un joli terrain plat, clos et arboré d\'environ 170 m².\nUne place de parking.\nDouble vitrage PVC\nChauffage gaz de ville\nTaxe foncière : 1400 euros\nCharges annuelles de 1684 euros (eau comprise)\nDPE : B (69) et GES : C (16)\nPrix : 248 000 euros\nPossibilité d\'acquérir un box en sous-sol pour 15.000 € en plus\nOrganisez une visite en contactant Stéphane au 06 36 48 88 44 !', 'Stéphane GAVELLE', 'david@vendez-votre-maison.fr', '06 36 48 88 44', '83520', 1, '43.3261369', '6.6493095', 'Roquebrune Sur Argens', '83107', 'FRA', 78, 4, 3, 78, 0, 'V', 'simple', 1, 248000, 'EUR', 19, 84, 'Terrasse, Jardin privatif', NULL, NULL, 69, 16, 'B', 'C', 0),
(14, '1544', 'Appartement - F2 - 95420', 'MAGNY EN VEXIN (95420), VENDS F2 35,83m²\nDans une petite copropriété, cet appartement est situé dans l\'hyper centre de Magny en Vexin, dans une rue pleine de charme, d\'environ 36m² composé d\'un séjour, une chambre, une salle d\'eau, avec vue sur la cathédrale !\nIdéal investisseurs !\nFenêtres PVC avec volets en bois.\nDPE vierge.\nVisite virtuelle disponible sur notre site !\nPrix : 85.000 euros', 'Amandine CAIGNET', 'amandine@vendez-votre-maison.fr', '07 63 40 18 01', '95420', 1, '49.156013', '1.7870268', 'Magny En Vexin', '95355', 'FRA', 35, 2, 1, 35, 1, 'V', 'simple', 1, 85000, 'EUR', 19, 96, NULL, NULL, 'https://www.meilleurevisite.com/visit/9499378e-1ef0-11e9-a6dd-00155d174307', NULL, NULL, NULL, NULL, 0),
(15, '1402', 'Appartement - T4', 'LA CHAPELLE EN SERVAL - Appartement T4 à vendre\nLachapelle en Serval, dans bâtisse ancienne en pierre, situé au 1er étage d\'une petite copropriété bénévole, appartement de 67.80m² comprenant: entrée, pièce de vie avec cuisine ouverte, salle d\'eau, WC séparés, 3 grandes chambres.\nTravaux à prévoir. Appartement spacieux et lumineux ! A visiter au plus vite !!\nLa ville de Lachapelle en Serval se situe aux portes du Val d\'Oise; membre de la communauté de commune de Chantilly vous pourrez profiter d\'une vie associative riche en animations diverses permettant à chaque habitant de s\'intégrer dans une activité sportive, culturelle, musicale, bien-être.\nLa commune bénéficie d\'une école primaire toute neuve proposant les services de garderie de 7h30 à 19h également durant les vacances scolaires.\nVisite virtuelle disponible sur notre site, cliquez ici !\nA visiter sans tarder pour 139 000 euros.\nPlus d\'informations en contactant directement Déborah au 06.41.60.68.79', 'Déborah PENA', 'deborah@vendez-votre-maison.fr', '06 41 60 68 79', '60520', 0, '49.1275959', '2.53451', 'Lachapelle En Serval', '60142', 'FRA', 67, 4, 3, 67, 0, 'V', 'simple', 1, 139000, 'EUR', 19, 61, NULL, NULL, 'https://www.meilleurevisite.com/visit/b47ec897-5770-11e9-9edd-00155d174307', 399, 13, 'F', 'C', 1),
(16, '1493', 'Appartement - T3', 'ERMONT (95120) - APPARTEMENT DE TYPE F3 A VENDRE\nVends, appartement de type F3 situé au 4ème et dernier étage comprenant : entrée avec placards à aménager, une vaste chambre + dressing, une cuisine équipée avec plaques de cuisson au gaz, machine à laver, four, lave-vaisselle et réfrigérateur donnant accès à une loggia, un wc séparé, une salle d\'eau, un séjour lumineux et une autre chambre.\nL\'appartement possède des fenêtres en double vitrage, un chauffage au sol, quelques travaux sont à prévoir.\nVous apprécierez la cave, l\'emplacement de stationnement dédié et la proximité des axes routiers et des écoles.\nErmont est une commune de plus de 27 000 habitants située dans le département du Val-d\'Oise, en région Île-de-France. Elle est membre de la Communauté d\'agglomération Val Parisis.\nGare la plus proche située à seulement 2 kilomètres !\nUne visite virtuelle est disponible sur notre site !\nA visiter sans tarder au prix de 145 000 euros\nPlus d\'informations en contactant Carlos au 07.50.06.33.28', 'Carlos LANCA', 'carlos@vendez-votre-maison.fr', '07 50 06 33 28', '95120', 0, '48.9890424', '2.2584566', 'Ermont', '95219', 'FRA', 53, 3, 2, 53, 1, 'V', 'simple', 1, 145000, 'EUR', 19, 96, NULL, NULL, 'https://www.meilleurevisite.com/visit/f6c4303f-4a61-11e9-9f6e-00155d174307', NULL, NULL, NULL, NULL, 0),
