(18, '1492', 'Terrain à bâtir - PROCHE FLEURY', 'TERRAIN CONSTRUCTIBLE A VENDRE\nVous avez un projet de construction proche de BOOS et de ROUEN ?\nVenez découvrir ce beau terrain de 715 m² situé à BOURG BEAUDOUIN, libre de constructeur.\nTerrain est situé en centre village, dans un environnement calme.\nFaçade de plus de 28 mètres sur rue et garage existant !\nCertificat d\'urbanisme opérationnel fourni sur demande et le terrain est vendu borné avec plan de géomètre (en téléchargement sur notre site).\nBOURG BEAUDOUIN est une commune proche de Fleury sur Andelle (7 minutes), où vous trouverez tous commerces.\nTerrain situé à une demi-heure de Rouen !\nPour la scolarité, toute la primaire est assurée par un regroupement scolaire entre Vandrimare et Bourg Beaudouin.\nPrix : 47.000 euros\nPlus besoin d\'hésiter, venez le visiter en contactant Yannick au 07.63.47.19.80 !', 'Yannick MERIEL', 'yannick@vendez-votre-maison.fr', '07 63 47 19 80', '27380', 1, '49.3601699', '1.355767', 'Fleury Sur Andelle', '27246', 'FRA', 715, NULL, NULL, NULL, 0, 'V', 'simple', 1, 47000, 'EUR', 1, 28, NULL, NULL, 'https://fichiers.ubiflow.net/19/03/12/19/5/bourg-beaudoin-plan-bornage.pdf', NULL, NULL, NULL, NULL, 0),
(19, '1488', 'Maison', 'PROCHE GAILLON (27) - Maison à vendre\nA proximité de la gare d\'Aubevoye qui dessert Paris Gare Saint-Lazare en 57 min, venez découvrir cette charmante maison d\'environ 80 m² implantée sur 496 m² de terrain, composée d\'une entrée, un salon avec cheminée, une cuisine indépendante, une salle d\'eau, un wc.\nA l\'étage, vous trouverez 2 chambres et un bureau.\nLa maison est édifiée sur cave totale et dispose d\'un chauffage au gaz de ville avec une chaudière récente.\nDPE : D (205) - GES : E (48)\nUne visite virtuelle est disponible sur notre site !\nCourcelles sur Seine dispose de quelques commerces de proximité (boulangerie, restaurant, épicerie) et une école. Le village est situé à 2 km de la gare d\'Aubevoye et 3km du centre-ville de Gaillon avec collège, lycée et supermarchés.\nPrix : 129.000 euros direct propriétaire !\nPlus d\'information en contactant Yannick au 07.63.47.19.80 !', 'Yannick MERIEL', 'yannick@vendez-votre-maison.fr', '07 63 47 19 80', '27600', 0, '49.160734', '1.33341', 'Gaillon', '27275', 'FRA', 80, 3, 2, 80, 0, 'V', 'simple', 1, 129000, 'EUR', 2, 28, NULL, '496', 'https://www.meilleurevisite.com/visit/6d4e6e49-0468-11e9-a6dd-00155d174307', 205, 48, 'D', 'E', 1),
(20, '1388', 'Terrain à bâtir', 'LES ANDELYS (27700) - TERRAIN CONSTRUCTIBLE A VENDRE\nDans un hameau des Andelys, venez découvrir ce superbe terrain d\'environ 2454 m², en assainissement individuel, non viabilisé, libre de constructeur avec une façade sur rue d\'environ 18m. Le terrain se situe dans un environnement calme et rural.\nCertificat d\'urbanisme positif sur demande et le terrain est vendu borné avec plan de géomètre.\nLe hameau de radeval se situe à 4 km du centre ville des Andelys, qui dispose de supermarchés, commerces de proximité, complexes sportifs et qui abrite le site historique et touristique du Château Gaillard.\nPrix : 49.000 euros\nPour toutes demandes d\'informations complémentaires, contactez Amandine au 07.63.40.18.01 !\nPlan de géomètre à télécharger sur notre site', 'Yannick MERIEL', 'yannick@vendez-votre-maison.fr', '07 63 47 19 80', '27700', 0, '49.246568', '1.4192', 'Les Andelys', '27016', 'FRA', 2454, NULL, NULL, NULL, 0, 'V', 'simple', 1, 49000, 'EUR', 1, 28, NULL, NULL, 'https://fichiers.ubiflow.net/18/10/24/04/5/les-andelys-gambon-plan-bornage.pdf', NULL, NULL, NULL, NULL, 1),
(21, '1379', 'Terrain à bâtir - BERNIERES', 'TERRAIN CONSTRUCTIBLE A VENDRE\nA Bernières sur Seine, dans un charmant village à proximité des Andelys et de Gaillon, venez découvrir ce terrain à bâtir d\'environ 1480m², libre de constructeur, en arrière-lot.\nCertificat d\'urbanisme opérationnel fourni sur demande.\nTerrain vendu borné avec plan de géomètre (en téléchargement sur notre site).\nBernières sur seine est un village qui fait partie de la commune nouvelle des Trois Lacs. Il se situe à 7 km des Andelys, et 10 km de Gaillon, où vous trouverez une gare, ainsi que l\'accès à l\'autoroute A13. Dans le village, à quelques mètres de la maison, se trouve une école primaire.\nPrix : 38.000 euros\nSi vous souhaitez plus d\'informations, n\'hésitez pas à contacter Yannick au 07.63.47.19.80 !', 'Yannick MERIEL', 'yannick@vendez-votre-maison.fr', '07 63 47 19 80', '27700', 0, '49.233306', '1.3394299', 'Bernieres Sur Seine', '27058', 'FRA', 1482, NULL, NULL, NULL, 0, 'V', 'simple', 1, 38000, 'EUR', 1, 28, NULL, NULL, 'https://fichiers.ubiflow.net/18/05/59/64/2/bernieres-sur-seine-plan-division.pdf', NULL, NULL, NULL, NULL, 0),
