(42, '1507', 'Maison', 'Idéal premier achat ou investisseur !\nA moins de 10 minutes de Nanteuil le Haudouin et 15 minutes du Plessis Belleville, Venez découvrir cette charmante maison d\'habitation comprenant entrée sur cuisine, salon, salle de bains, WC séparés.\nA l\'étage vous trouverez 2 chambres.\nVous bénéficierez également d\'un garage, ainsi que d\'un jardin, le tout sur environ 350 m² !\nProduit rare sur ce secteur à ce prix !\nUne visite virtuelle est disponible sur notre site.\nMaison située dans un paisible village, proche de Nanteuil le Haudouin et du Plessis Belleville où vous trouverez tout le nécessaire : école, périscolaire, activité sportive, médecin, pharmacie. Vous trouverez également au Plessis Belleville un grand centre commercial.\nSitué à moins de 10 min de la gare, grâce à laquelle pour regagnez Paris Gare du Nord en 30 minutes, et à moins de 10 minutes de la N2, pour regagnez Roissy CDG en 20 minutes seulement !\nN\'hésitez plus, contacter Monsieur LEFRANC de l\'agence L\'ADRESSE TLG CATENNE au 06.87.86.50.41', 'IN VESTISS FRANCE', 'alexandre@vendez-votre-maison.fr', '06 87 86 50 41', '60440', 0, '49.116448', '2.857291', 'Chevreville', '60148', 'FRA', 53, 3, 2, 53, 1, 'V', 'simple', 1, 125000, 'EUR', 2, 61, NULL, '320', 'https://www.meilleurevisite.com/visit/c5e0068c-7cab-11e9-bf5f-00155d174307', NULL, NULL, NULL, NULL, 0),
