(51, '1458', 'Pavillon récent', 'SAINTE GENEVIEVE (60) - Vends pavillon récent 105m²\nDans quartier calme de Sainte Geneviève, à 15 minutes de Chambly, vends Pavillon récent et indépendant de 105 m² , comprenant salon séjour avec cuisine ouverte, une chambre.\nA l\'étage , trois chambres , une salle de bains et un WC séparé.\nChauffage électrique.\nLe tout sur un joli terrain de 500 m².\nLa vie à Sainte-Geneviève :\nCommerces de proximité : boulangeries, charcuterie, supermarché avec station essence et bureau de poste\nEcole primaire avec cantine et périscolaire\nPrix : 215 000 euros direct propriétaire\nUne visite en 360° disponible sur notre site !\nContactez Jérôme au 06 06 71 64 54 pour plus d\'informations', 'Jérôme GENDRON', 'jerome@vendez-votre-maison.fr', '06 06 71 64 54', '60730', 0, '49.290147', '2.197309', 'Sainte Genevieve', '60575', 'FRA', 105, 6, 4, 105, 0, 'V', 'simple', 1, 215000, 'EUR', 2, 61, NULL, '500', 'https://www.meilleurevisite.com/visit/fc89b5e9-e8e4-11e8-a6dd-00155d174307', 260, 10, 'E', 'B', 0),
