(57, '1446', 'Maison ancienne', 'BETHISY SAINT PIERRE (60320) - MAISON A VENDRE\nVenez découvrir cette très jolie maison ancienne de 88m² environ proche du centre-ville de Béthisy Saint Pierre.\nElle comprend une entrée sur une belle cuisine équipée, séjour , 1 chambre et salle d\'eau, et à l\'étage 2 chambres et une salle d\'eau, cave, dépendance et jardinet bien exposé plein sud.\nDPE : E (327) - GES : B (10)\nBeau Potentiel. Secteur calme. A Visiter très vite\nPetit Village dans lequel vous retrouvez toutes les commodités (commerces, écoles, ) et situé à 20 minutes de Crépy en Valois, grande ville où toutes les commodités sont présentes : hôpitaux, médecins, écoles (de la maternelle aux études supérieures), activités sportives et culturelles, centre commercial\nA vendre au prix de 149 000 euros - Honoraires de négociation charge vendeur inclus\nPour visiter, contactez sans plus tarder Luis Thomas de l\'agence IAD au 06.52.88.29.15', 'Thomas - IAD', 'jerome@vendez-votre-maison.fr', '06 52 88 29 15', '60320', 0, '49.298519', '2.802371', 'Bethisy Saint Pierre', '60068', 'FRA', 88, 4, 3, 88, 0, 'V', 'simple', 1, 149000, 'EUR', 2, 61, NULL, NULL, NULL, 327, 10, 'E', 'B', 1),
