(102, '1517', 'Maison sur sous-sol total', 'AULNAY SOUS-BOIS (93600) - Maison à vendre sur sous-sol total\nNouveau, dans Aulnay \"Vieux pays\", vends maison élevée sur sous sol total avec garage offrant : entrée, salon, cuisine ouverte, wc indépendant, 2 chambres, salle d\'eau.\nLe tout sur un jardin d’environ 262m².\nA découvrir sans tarder pour 242.000 € - Honoraires de négociation charge vendeur inclus\nContactez Alain ZERMATTI 06.19.89.65.73\nVenez découvrir cette maison à proximité de la future ligne 16. Proche toutes commodités : bus, commerces, écoles, et crèche à 5 minutes.', 'Alain ZERMATTI', 'carlos@vendez-votre-maison.fr', '06 19 89 65 73', '93600', 0, '48.9412151', '2.4970711', 'Aulnay Sous Bois', '93005', 'FRA', NULL, 4, 2, NULL, 0, 'V', 'exclusif', 1, 242000, 'EUR', 2, 94, 'Garage, Jardin privatif', '262', NULL, NULL, NULL, NULL, NULL, 0),
