(112, '1511', 'Terrain à bâtir - SAINT-FELIX', 'TERRAIN CONSTRUCTIBLE A VENDRE\nSaint-Félix, magnifique terrain à bâtir plat de 909m² avec une façade de 28ml et garage déjà existant sur le terrain, libre de constructeur !\nCommune en tout à l\'égout , hors Bâtiment de France.\nA visiter sans tarder pour 79 000 €.\nContact Déborah au 06 41 60 68 79\nProfitez de la gare de Mouy située à seulement 8 minutes de la commune de Saint-Félix.\nIdéalement située sur l\'axe Creil/Beauvais, la commune bénéficie des écoles maternelles et primaires ainsi que d\'une cantine et d\'un accueil périscolaire de 7h à 18h45.\nVenez prendre un bol d\'air frais sur cette commune verdoyante idéalement entourée de forêts et d\'étangs !!', 'IN VESTISS FRANCE', 'deborah@vendez-votre-maison.fr', '03 44 19 14 57', '60370', 1, '49.3467176', '2.2892428', 'Saint Felix', '60574', 'FRA', 909, NULL, NULL, NULL, 0, 'V', 'simple', 1, 79000, 'EUR', 1, 61, NULL, NULL, 'https://fichiers.ubiflow.net/19/46/57/57/1/st-felix-plan-division.pdf', NULL, NULL, NULL, NULL, 0),
