(116, '1478', 'Maison', 'LE PLESSIS HEBERT - MAISON A VENDRE\nComposée d\'un coin cuisine, séjour avec cheminée donnant sur une terrasse bien exposée, 2 chambres, salle d\'eau et WC séparé.\nElle est agrémentée d\'un jardin d\'environ 835m², située à 5km de Pacy sur Eure, de ses commerces et de ses écoles !\nAssainissement individuel, Chauffage gaz (chaudière récente)\nDPE : (292) - GES : (80)\nPrix : 74.000 euros\nPlus d\'information en contactant Amandine au 07.63.40.18.01', 'Amandine CAIGNET', 'amandine@vendez-votre-maison.fr', '07 63 40 18 01', '27120', 0, '49.013679', '1.381434', 'Pacy Sur Eure', '27448', 'FRA', 47, 3, 2, 47, 0, 'V', 'simple', 1, 74000, 'EUR', 2, 28, NULL, '835', NULL, 292, 80, 'E', 'F', 0),
(117, '1540', 'Maison', 'La Rivière Saint-Sauveur (14600) - Maison F2 à vendre 45m²\nCommune limitrophe de Honfleur, proche de toutes commodités, vends maison de 2006 de 2 pièces offrant une magnifique vue dégagée sur la Vallée !\nMaison comprenant, entrée avec placard, cuisine ouverte sur le séjour, wc indépendant, à l\'étage une chambre et une salle de bains.\nJardinet exposé au Sud et parking privatifs !\nChauffage et production d\'eau chaude : individuel et électrique\nBien en copropriété de 39 maisons, dont les charges sont de 96,93 euros/trimestre\nDPE : E (276) - GES :  - C (13,5)\nLa vie à LA RIVIERE SAINT-SAUVEUR : vous trouverez un bureau de poste, des boulangeries, une crèche, une maternelle et une primaire, des médecins et une pharmacie. Toutes les commodités se trouvent à moins de 10 minutes sur la commune de HONFLEUR avec accès Port et Plage !\nVidéo en 360° disponible sur notre site !\nAlors n\'hésitez plus, contactez-moi au 07.63.40.18.01 pour venir la visiter !\nPrix : 93.000 euros direct propriétaire', 'Amandine CAIGNET', 'amandine@vendez-votre-maison.fr', '07 63 40 18 01', '14600', 1, '49.418762', '0.233262', 'Honfleur', '14333', 'FRA', 45, 2, 1, 45, 0, 'V', 'simple', 1, 93000, 'EUR', 2, 14, NULL, '65', 'https://www.meilleurevisite.com/visit/44e50d2b-2bb7-11e9-a6dd-00155d174307', 276, 13, 'E', 'C', 0),
(118, '1515', 'Maison sur sous-sol total', 'MAISON SUR SOUS-SOL TOTAL A VENDRE\nA 5 minutes de Gisors, d\'une superficie de 88m² comprenant 4 chambres, double séjour, cuisine indépendante, salle de bains.\nLa maison est reliée au tout à l\'égout.\nLe tout sur un terrain d\'environ 580m²\nDPE : E (316) - GES : G (94)\nTaxes foncières : 560 euros\nVisite virtuelle disponible sur notre site !\nLa vie à Bézu Saint-Eloi :\nVous trouverez un bureau de poste, une boulangerie, l\'école primaire et des médecins. Toutes les commodités de Gisors à 5 minutes !\nPrix : 149.000 euros\nPlus d\'informations en contactant Amandine au 07.63.40.18.01', 'IN VESTISS France', 'amandine@vendez-votre-maison.fr', '07 63 40 18 01', '27140', 0, '49.279774', '1.776579', 'Gisors', '27284', 'FRA', 88, 5, 4, 88, 0, 'V', 'simple', 1, 149000, 'EUR', 2, 28, 'Garage', '581', 'https://www.meilleurevisite.com/visit/d83fcf0d-1f23-11e9-a6dd-00155d174307', 316, 94, 'E', 'G', 0),
