(143, '1566', 'Terrain à bâtir - DRESLINCOURT', 'TERRAIN CONSTRUCTIBLE A VENDRE\nVenez découvrir ce magnifique terrain à bâtir d\'environ 480m² plat et semi clôturé.\nTout à l’égout, vendu borné avec un certificat d’urbanisme opérationnel.\nSecteur calme, idéal.\nPrix : 53 000 € direct propriétaire.\nPetite ville dans laquelle vous avez toutes les commodités (commerces, écoles, supermarché, etc …) et à 20 minutes de Compiègne, grande ville où toutes les commodités sont présentes : hôpitaux, médecins, écoles (de la maternelle aux études supérieures), activités sportives et culturelles (musée), centre commercial…\nPour visiter ou obtenir plus de renseignements, contactez Aurélie au 06.23.75.23.79', 'Aurélie LEPINE', 'aurelie@vendez-votre-maison.fr', '06 23 75 23 79', '60170', 1, '49.510356', '2.922679', 'Ribecourt Dreslincourt', '60537', 'FRA', 480, NULL, NULL, NULL, 0, 'V', 'simple', 1, 53000, 'EUR', 1, 61, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0),
(144, '1567', 'Maison avec véranda', 'PROCHE MOUY - MAISON A VENDRE\nDans un environnement calme et privilégié, vends jolie maison ancienne comprenant entrée dans véranda, entrée avec WC et placards.\nCuisine aménagée équipée, salon séjour double avec cheminée, 5 chambres, 1 salle de bains et une salle d\'eau.\nGrenier aménageable !\nJardin et terrasse.\nA visiter au plus vite au prix de 199 000 €\nA 5 minutes de MOUY et de sa gare, avec écoles maternelle et primaire dans le village (Saint-Félix).\nPlus d\'information et prendre rendez-vous pour visiter en contactant Déborah au 06 41 60 68 79', 'Déborah PENA', 'deborah@vendez-votre-maison.fr', '06 41 60 68 79', '60250', 1, '49.319128', '2.319705', 'Mouy', '60439', 'FRA', 170, 7, 5, 170, 0, 'V', 'simple', 1, 199000, 'EUR', 2, 61, 'Terrasse, Cave, Cheminée', '654', NULL, 259, 14, 'E', 'C', 0),
(145, '1570', 'Terrain à bâtir - PONTOISE', 'TERRAIN CONSTRUCTIBLE A VENDRE\nArronville petit village préservé du Vexin, proche PONTOISE, très beau terrain à bâtir plat de 432m² avec belle façade de 24m !\nCommune raccordée au tout à l\'égout.\nLe terrain est situé dans le périmètre des Bâtiments de France et libre de constructeur.\nCertificat d\'urbanisme positif sur demande et le terrain est vendu borné avec plan de géomètre.\nEcole primaire à 10 minutes à pieds, Garderie, centre aéré ...\nRamassage scolaire pour école supérieure,\nGare la plus proche à 10 mm en voiture puis 1/2 heure des portes de PARIS\nCentre commercial le plus proche à seulement 14 km\nPrix : 82.000 euros\nPour plus d\'information, contactez Carlos au 07.50.06.33.28', 'Carlos LANCA', 'carlos@vendez-votre-maison.fr', '07 50 06 33 28', '95000', 0, '49.0331671', '2.0547222', 'Pontoise', '95500', 'FRA', 432, NULL, NULL, NULL, 0, 'V', 'simple', 1, 82000, 'EUR', 1, 96, NULL, NULL, 'https://fichiers.ubiflow.net/19/85/33/81/6/arronville-11-plan-division.pdf', NULL, NULL, NULL, NULL, 1),
(146, '1569', 'Terrain à bâtir - PROCHE NOGENT LE ROI', 'TERRAIN CONSTRUCTIBLE A VENDRE\n4km de NOGENT LE ROI (28210), très beau terrain à bâtir de 1583m² en arrière-lot avec une entrée sur rue de plus de 4,80m de large, libre de constructeur.\nCertificat d\'urbanisme positif sur demande et le terrain est vendu borné, avec plan de géomètre.\nPrix : 51.000 euros\nPlus d\'informations en contactant Nelson au 06 34 14 08 50', 'Nelson FONSECA', 'nelson@vendez-votre-maison.fr', '06 34 14 08 50', '28210', 1, '48.647832', '1.530432', 'Nogent Le Roi', '28279', 'FRA', 1583, NULL, NULL, NULL, 0, 'V', 'simple', 1, 51000, 'EUR', 1, 29, NULL, NULL, 'https://fichiers.ubiflow.net/19/85/28/94/1/chaudon-mauzaize-plan-division.pdf', NULL, NULL, NULL, NULL, 0),
(147, '1568', 'Terrain à bâtir - BREUIL LE VERT', 'TERRAIN CONSTRUCTIBLE A VENDRE\nTerrain à bâtir plat de 617m² avec façade de 30ml !!!\nCommune avec tout à l’égout ; hors périmètre des bâtiments de France.\nCertificat d\'urbanisme positif sur demande et le terrain est vendu borné, avec plan de géomètre.\nA Visiter sans tarder pour 79 000 euros\nBreuil le vert, commune du Clermontois bénéficiant des infrastructures de la ville de Clermont : Gare rejoignant Paris Nord en 40 minutes.\nÉcoles maternelles et primaires avec cantines et périscolaires.\nCollèges, lycées et commerces vous accueillent sur la commune.\nPlus d\'informations en contactant Déborah au 06.41.60.68.79', 'Déborah PENA', 'deborah@vendez-votre-maison.fr', '06 41 60 68 79', '60600', 1, '49.3648433', '2.4346555', 'Breuil Le Vert', '60107', 'FRA', 617, NULL, NULL, NULL, 0, 'V', 'simple', 1, 79000, 'EUR', 1, 61, NULL, NULL, 'https://fichiers.ubiflow.net/19/85/28/49/1/breuil-le-vert-plan-division.pdf', NULL, NULL, NULL, NULL, 0),
(148, '1571', 'Maison récente', 'L\'OUDON (14170) - MAISON RECENTE A VENDRE\nA l\'OUDON commune de SAINT-PIERRE en AUGE, petit village pittoresque de Normandie situé au sud-ouest du Pays d\'Auge, vends pavillon de 5 pièces composé d\'un salon-séjour avec coin cuisine, de 3 chambres, d\'une salle d\'eau et d\'un WC au rez-de-chaussée.\nÉtage composé de 2 pièces totalisant environ 40m² à aménager, possibilité de faire 2 chambres supplémentaires !\nTerrasse d\'environ 20m² et jardin de plus de 3400m² !\nPavillon de 2012 avec travaux de finition à prévoir.\nDPE : D (212) - GES : A (4)\nUne visite virtuelle est disponible sur notre site !\nPrix : 130.000 euros direct propriétaire\nPlus d\'informations en contactant Amandine au 07.63.40.18.01', 'Amandine CAIGNET', 'amandine@vendez-votre-maison.fr', '07 63 40 18 01', '14170', 1, '48.967851', '0.07453', 'L Oudon', '14697', 'FRA', 110, 5, 3, 110, 0, 'V', 'simple', 1, 130000, 'EUR', 2, 14, 'Terrasse', '3483', 'https://www.meilleurevisite.com/visit/f6fc26bf-879e-11e9-bf5f-00155d174307', 212, 4, 'D', 'A', 0),
(149, '1573', 'Maison rénovée', 'ENTRE VILLERS COTTERETS ET SOISSONS - MAISON A VENDRE\nVenez découvrir cette belle maison ancienne de 65 m² environ rénovée avec goût, comprenant de plain- pied entrée sur séjour, cuisine, salle d’eau avec wc, 3 chambres.\nBelle cave voûtée, sur un jardin de 920 m² !\nLe plus de cette maison : un grenier aménageable, gros potentiel !!\nUne visite virtuelle est disponible sur notre site.\nSituée à 10 minutes de Villers Cotterêts et sa gare, qui vous permettra de rejoindre Paris (Gare du Nord) en moins d’1 heure, et son accès direct à la N2 qui vous emmènera à Roissy CDG en 45 minutes seulement !\nVous y trouverez toutes les commodités sur place !\nPrix : 134.000 € - Honoraires de négociation charge vendeur inclus\nN’hésitez plus, contactez Jérémy Noiret de l’Agence Arthurimmo au 06.78.48.18.44 pour venir la visiter !', 'Jérémy NOIRET - Arthurimmo', 'alexandre@vendez-votre-maison.fr', '06 78 48 18 44', '02600', 1, '49.338993', '3.154595', 'Coeuvres Et Valsery', '02201', 'FRA', 65, 4, 3, 65, 1, 'V', 'simple', 1, 134000, 'EUR', 2, 2, 'Cave', '920', 'https://www.meilleurevisite.com/visit/8accb6b0-7cab-11e9-bf5f-00155d174307', NULL, NULL, NULL, NULL, 0),
