(152, '1576', 'Terrain à bâtir - PROCHE THOUROTTE', 'TERRAIN CONSTRUCTIBLE A VENDRE\nSitué à 5 minutes de Thourotte, dans le village de MONTMACQ, terrain à bâtir plat de 453m², 25 mètres de façade sur rue, libre de constructeur, avec tout à l\'égout dans le village.\nPrix : 49.000 € - Direct propriétaire\nLe terrain est vendu borné avec plan de géomètre (téléchargeable sur notre site) et certificat d\'urbanisme transmis sur demande.\nN\'hésitez plus et contactez Aurélie au 06.23.75.23.79 pour plus d\'informations !', 'Aurélie LEPINE', 'aurelie@vendez-votre-maison.fr', '06 23 75 23 79', '60150', 1, '49.47858', '2.883769', 'Thourotte', '60636', 'FRA', 453, NULL, NULL, NULL, 0, 'V', 'simple', 1, 49000, 'EUR', 1, 61, NULL, NULL, 'https://fichiers.ubiflow.net/19/91/24/73/5/montmacq-caille-plan-bornage.pdf', NULL, NULL, NULL, NULL, 0),
(153, '1575', 'T3 - Idéal investisseurs ou premier achat !', 'VILLERS COTTERETS - F3 A VENDRE, IDÉAL INVESTISSEUR OU PREMIER ACHAT !\nVenez découvrir ce bel appartement de 41 m² en duplex vous offrant salon avec cuisine ouverte équipée, 2 chambres, salle de bains.\nCet appartement se trouve dans une petite copropriété, avec de très faibles charges (environ 150 euros/an)\nLe plus de l\'appartement : une grande cave !\nDPE VIERGE\nCet appartement se situe à VILLERS COTTERETS, commune de l\'Aisne, proche de l\'Oise où vous trouverez centre commercial, médecins, pharmacie, activités sportives et culturelles (musée, château).\nLa gare se trouve à moins de 5 minutes à pieds de l\'appartement et vous permet de regagner Paris (Gare du Nord) en 50 minutes, le centre-ville à moins de 8 minutes\npieds.\nAccès N2 rapide (axe Paris).\nPRIX : 65 000 euros direct propriétaire\nN\'hésitez plus, contactez Alexandre au 06.10.21.66.24 !', 'Alexandre RAMOS', 'alexandre@vendez-votre-maison.fr', '06 10 21 66 24', '02600', 1, '49.2522025', '3.0967497', 'Villers Cotterets', '02810', 'FRA', 41, 3, 2, 41, 1, 'V', 'simple', 1, 65000, 'EUR', 19, 2, 'Cave', NULL, NULL, NULL, NULL, NULL, NULL, 0),
(154, '1579', 'Pavillon', 'LACHAPELLE SAINT PIERRE 60730 - PAVILLON A VENDRE\nAu cœur du village de Lachapelle Saint-Pierre, vends joli pavillon récent de 115 m² offrant entrée sur salon séjour, une chambre au rez-de-chaussée, une cuisine ouverte, un WC et une salle d\'eau à terminer.\nA l\'étage : 4 chambres, une salle de bains et un WC.\nJardin de 350 m² environ.\nPrévoir travaux.\nDPE : C     GES : B\nCommune raccordée au tout à l\'égout, taxe foncière de 900 euros/an, village prisé de par sa tranquillité, son école primaire avec cantine et périscolaire, ses transports en BUS pour Neuilly en Thelle, ses activités sportives avec son club de fitness et de danse contemporaine.\nPrix : 195.000 euros honoraires de négociation charge vendeur inclus\nVous voulez plus d\'informations ou organiser une visite ? Contactez Fanny au 06.35.25.60.71 !', 'Jérôme GENDRON', 'jerome@vendez-votre-maison.fr', '06 06 71 64 54', '60730', 1, '49.267688', '2.234727', 'Lachapelle Saint Pierre', '60334', 'FRA', 115, 6, 5, 115, 0, 'V', 'simple', 1, 195000, 'EUR', 2, 61, NULL, '356', NULL, NULL, NULL, 'C', 'B', 0),
(155, '1578', 'Terrain à bâtir - MARCILLY', 'TERRAIN CONSTRUCTIBLE A VENDRE\nA 10 minutes de Nonancourt et St Lubin des Joncherets, proche de l\'accès à la N154, terrain à bâtir d\'environ 1577m², façade d\'environ 34ml sur rue et libre de constructeur.\nCertificat d\'urbanisme positif sur demande et le terrain est vendu borné avec plan de géomètre.\nPour tout complément d\'information, merci de nous contacter au 06.36.41.95.48\nPrix : 70.000 euros direct propriétaire !', 'Margot DUJARDIN', 'margot@vendez-votre-maison.fr', '06 36 41 95 48', '27320', 1, '48.833473', '1.200879', 'Marcilly La Campagne', '27390', 'FRA', 1577, NULL, NULL, NULL, 0, 'V', 'simple', 1, 70000, 'EUR', 1, 28, NULL, NULL, 'https://fichiers.ubiflow.net/19/92/68/12/6/marcilly-la-campagne-vr-plan-bornage.pdf', NULL, NULL, NULL, NULL, 0),
(156, '1577', 'Appartement - T4', 'LA CHAPELLE EN SERVAL - Appartement T4 à vendre\nLa Chapelle en Serval, dans bâtisse ancienne en pierre, situé au 1er étage d\'une petite copropriété bénévole, appartement de 67.80m² comprenant : entrée, pièce de vie avec cuisine ouverte, salle d\'eau, WC séparés, 3 grandes chambres.\nTravaux à prévoir. Appartement spacieux et lumineux ! A visiter au plus vite !!\nLa ville de Lachapelle en Serval se situe aux portes du Val d\'Oise ; membre de la communauté de commune de Chantilly vous pourrez profiter d\'une vie associative riche en animations diverses permettant à chaque habitant de s\'intégrer dans une activité sportive, culturelle, musicale, bien-être.\nLa commune bénéficie d\'une école primaire toute neuve proposant les services de garderie de 7h30 à 19h également durant les vacances scolaires.\nVisite virtuelle disponible sur notre site, cliquez ici !\nA visiter sans tarder pour 139 000 euros.\nPlus d\'informations en contactant directement Déborah au 06.41.60.68.79', 'Déborah PENA', 'deborah@vendez-votre-maison.fr', '06 41 60 68 79', '60520', 1, '49.1275959', '2.53451', 'La Chapelle En Serval', '60142', 'FRA', 67, 4, 3, 67, 0, 'V', 'simple', 1, 139000, 'EUR', 19, 61, NULL, NULL, 'https://www.meilleurevisite.com/visit/b47ec897-5770-11e9-9edd-00155d174307', 399, 13, 'F', 'C', 0),
