(158, '1581', 'Terrain à bâtir - SAULNIERES', 'TERRAIN CONSTRUCTIBLE A VENDRE\nSaulnières, 10 minutes de Vernouillet, 150 mètres de l\'école, terrain à bâtir de plus de 2850m², libre de constructeur !\nCertificat d\'urbanisme positif sur demande et le terrain est vendu borné avec plan de géomètre.\nPrix : 42.000 euros\nPlus d\'informations en contactant Nelson au 06.34.14.08.50 !', 'Nelson FONSECA', 'nelson@vendez-votre-maison.fr', '06 34 14 08 50', '28500', 0, '48.658526', '1.27365', 'Saulnieres', '28369', 'FRA', 2858, NULL, NULL, NULL, 0, 'V', 'simple', 1, 42000, 'EUR', 1, 29, NULL, NULL, 'https://fichiers.ubiflow.net/19/95/18/46/7/saulnieres-butte-plan-division.pdf', NULL, NULL, NULL, NULL, 0);
