(185, '1609', 'Maison ancienne', 'BETHISY SAINT PIERRE (60320) - MAISON A VENDRE\nVenez découvrir cette très jolie maison ancienne de 88m² environ proche du centre-ville de Béthisy Saint Pierre.\nComprenant une entrée sur une belle pièce de vie, cuisine aménagée équipée, 1 chambre, salle d’eau, et à l\'étage 2 chambre s et une salle d\'eau, cave, dépendance et jardinet bien\nexposé plein sud.\nDPE : E (327) - G ES : B (10)\nBeau Potentiel. Secteur calm e. A Visiter très vite\nPetit Village dans lequel vous retrouvez toutes le s commodités (commerces, écoles, ) et situé à 20 minutes de Crépy en Valois, grande ville où toutes les commodités sont\nprésentes : hôpitaux, médecins, écoles (de la maternelle aux études supérieures), activités sportives et culturelles, centre commercial\nA vendre au prix de 149 000 euros - Honoraires de négociation charge vendeur inclus\nPour visiter, contactez sans plus tarder Christelle ALLAIRE de l’agence IAD au 06.48.70.16.45', 'Christelle ALLAIRE de l’agence IAD', 'aurelie@vendez-votre-maison.fr', '06 48 70 16 45', '60320', 0, '49.298519', '2.802371', 'Bethisy Saint Pierre', '60068', 'FRA', 88, 4, 3, 88, 0, 'V', 'simple', 1, 149000, 'EUR', 2, 61, NULL, NULL, NULL, 327, 10, 'E', 'B', 0),
(186, '1608', 'Maison à rénover', 'MAISON A VENDRE\nAux portes d\'Estrées St Denis et Rémi, maison à restaurer comprenant une entrée sur une belle pièce de vie de plus de 38m² avec sa cuisine ouverte, salle d\'eau et wc.\nA l\'étage deux chambres et un grenier aménageable.\nBEAU potentiel pour les Amoureux du Bricolage.\nA vendre au prix de 97 000€ - honoraires de négociation charge vendeur inclus.\nVenez vite la visiter en contactant l\'agence Collin Immobilier au 03.44.09.49.11\nProche d\'Estrées St Denis, Ville où vous avez toutes les commodités commerces, écoles, …) et à 20 minutes de Compiègne, grande ville où toutes les commodités sont présentes : hôpitaux, médecins, écoles (de la maternelle aux études supérieures), activités sportives et culturelles, centre commercial…', 'Collin Immobilier', 'aurelie@vendez-votre-maison.fr', '03 44 09 49 11', '60190', 1, '49.426325', '2.6396609', 'Estrees Saint Denis', '60223', 'FRA', 85, 3, 2, 85, 1, 'V', 'simple', 1, 97000, 'EUR', 2, 61, NULL, '180', NULL, NULL, NULL, NULL, NULL, 0),
(187, '1607', 'Terrain à bâtir', 'TERRAIN CONSTRUCTIBLE A VENDRE\nSecteur Méru, environ 969m² non viabilisé avec certificat d\'urbanisme positif et plan de géomètre en téléchargement sur notre site.\nLibre de constructeur.\nÉcole primaire dans le village, proche autoroute Cergy.\nPrix : 48.000 euros direct propriétaire\nPour tout complément d\'information, contactez-moi au 06 06 71 64 54', 'Jérôme GENDRON', 'jerome@vendez-votre-maison.fr', '06 06 71 64 54', '60110', 1, '49.236009', '2.13544', 'Meru', '60395', 'FRA', 969, NULL, NULL, NULL, 0, 'V', 'simple', 1, 48000, 'EUR', 1, 61, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0),
(188, '1612', 'Maison de plain-pied', 'MAISON A VENDRE\nA Creil, quartier Cavée de Senlis, Maison de plain pied comprenant séjour, cuisine aménagée, 2 chambres, salle d’eau, WC.\nPetite dépendance de 20 m² comprenant la chaufferie. Accès véhicule possible.\nLe tout sur une courette de 269 m².\nTravaux de rafraichissement à prévoir.\nTous commerces à proximité + Ecoles, collège, lycée, hôpital.\nAutoroute A1 à 10 minutes, Bus, Gare Paris nord.\nMieux qu’un appartement au prix de 129 000 € !\nPlus d\'information en contactant Jérôme au 06.06.71.64.54', 'Jérôme GENDRON', 'jerome@vendez-votre-maison.fr', '06 06 71 64 54', '60100', 1, '49.253421', '2.4875108', 'Creil', '60175', 'FRA', 65, 3, 2, 65, 0, 'V', 'simple', 1, 129000, 'EUR', 2, 61, NULL, '269', NULL, 648, 162, 'G', 'G', 0),
(189, '1611', 'Terrain à bâtir', 'TERRAIN CONSTRUCTIBLE A VENDRE\nAux portes d’ESTREES SAINT-DENIS, beau terrain plat et semi clôturé de 440m² environ avec accès véhicule.\nVendu borné avec un certificat d’urbanisme opérationnel. Non classé en ABF.\nProches toutes commodités.\nVillage situé à 20 minutes de Compiègne, grande ville où toutes les commodités sont présentes : hôpitaux, médecins, écoles (de la maternelle aux études supérieures), activités sportives et culturelles, centre commercial…\nPour le visiter contactez au plus vite Aurélie au 06.23.75.23.79', 'Aurélie LEPINE', 'aurelie@vendez-votre-maison.fr', '06 23 75 23 79', '60190', 1, '49.465431', '2.690721', 'Montmartin', '60424', 'FRA', 440, NULL, NULL, NULL, 0, 'V', 'simple', 1, 55000, 'EUR', 1, 61, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0),
(190, '1613', 'Maison à fort potentiel', 'MAISON A FORT POTENTIEL\nIdéal premier achat ou investisseur !\nA 10 minutes de Crépy en Valois, venez découvrir cette charmante maison d’habitation comprenant entrée sur  salon, salle d\'eau, wc, 2 pièces.\nA l’étage, vous trouverez un grenier aménageable de près de 45 m² pouvant vous offrir, une fois aménagé, une surface total de 90 m² !\nVous bénéficierez également d’un garage, ainsi que d’un jardin, le tout sur environ 400 m² !\nTravaux à prévoir.\nProduit rare sur ce secteur à ce prix !\nVillage paisible, proche de Crépy en Valois où vous trouverez tout le nécessaire : école, périscolaire, activités sportives, médecin, pharmacie.\nVous trouverez également un centre commercial.\nSitué à 10 minutes de la gare, grâce à laquelle vous pouvez regagner Paris Gare du Nord en 35 minutes.\nN’hésitez plus, contactez Madame ANDRIEU, de l’agence CENTURY 21 au 06.20.90.55.46', 'Mme ANDRIEU CENTURY 21 CREPY', 'alexandre@venez-votre-maison.fr', '06 20 90 55 46', '60123', 1, '49.2812419', '2.9827281', 'Bonneuil En Valois', '60083', 'FRA', 45, 3, 1, 45, 1, 'V', 'simple', 1, 93700, 'EUR', 2, 61, NULL, '400', NULL, NULL, NULL, NULL, NULL, 0),
(191, '1615', 'Terrain à bâtir', 'GRAND TERRAIN CONSTRUCTIBLE A VENDRE\nA 10 minutes de Crépy en Valois, venez découvrir ce beau terrain à bâtir plat, d\'une surface de 2 500 m².\nTout à l\'égout sur place, hors secteur des bâtiments de France,\nProduit rare sur ce secteur à ce prix !\nTerrain situé dans un paisible village, proche de Crépy en Valois où vous trouverez tout le nécessaire : école, périscolaire, activité sportive, médecin, pharmacie. Vous trouverez également à Crépy en Valois, un centre commercial.\nSitué à 10 minutes de la gare, grâce à laquelle vous rejoignez Paris Gare du Nord en 35 minutes.\nN’hésitez plus, contactez Madame ANDRIEU, de l’agence CENTURY 21 au 06.20.90.55.46', 'Mme ANDRIEU CENTURY 21 CREPY', 'alexandre@vendez-votre-maison.fr', '06 20 90 55 46', '60123', 1, '49.2812419', '2.9827281', 'Bonneuil En Valois', '60083', 'FRA', 2500, NULL, NULL, NULL, 0, 'V', 'simple', 1, 50000, 'EUR', 1, 61, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0),
(192, '1614', 'Idéal premier achat', 'MAISON A FORT POTENTIEL A VENDRE\nIdéal premier achat ou investisseur !\nA 10 minutes de Crépy en Valois, venez la découvrir ! Comprenant entrée, 2 grandes pièces pour laisser court à votre imagination !\nA l’étage vous trouverez un grenier aménageable de près de 45 m², pouvant vous offrir, une fois aménagé, une surface total de 90 m² !\nVous bénéficierez également  d’un jardin, le tout sur environ 400 m² !\nTravaux à prévoir,\nProduit rare sur ce secteur à ce prix !\nMaison située dans un paisible village, proche de Crépy en Valois où vous trouverez tout le nécessaire : école, périscolaire, activité sportive, médecin, pharmacie. Vous trouverez également à Crépy en Valois, un centre commercial.\nSitué à 10 minutes de la gare, grâce à laquelle vous rejoignez Paris Gare du Nord en 35 minutes,\nN’hésitez plus, contacter Madame ANDRIEU, de l’agence CENTURY 21 au 06.20.90.55.46', 'Mme ANDRIEU CENTURY 21 CREPY', 'alexandre@vendez-votre-maison.fr', '06 20 90 55 46', '60800', 1, '49.2361549', '2.890059', 'Crepy En Valois', '60176', 'FRA', 45, 3, NULL, 45, 1, 'V', 'simple', 1, 82800, 'EUR', 2, 61, NULL, '400', NULL, NULL, NULL, NULL, NULL, 0),
(193, '1616', 'Terrain à bâtir', 'TERRAIN CONSTRUCTIBLE A VENDRE\nProche Chaumont en Vexin, au calme, terrain de 17 mètres de façade sur rue et d\'une surface de 1800m², libre de constructeur.\nCertificat d\'urbanisme positif sur demande et le terrain est vendu borné avec plan de géomètre (en téléchargement sur notre site).\nLe PLUS : village desservi par la fibre !\nVillage avec un bar/tabac et disposant d\'un regroupement scolaire + gare à 10 minutes axe Paris\nPrix : 60 000 euros\nPlus d\'informations en contactant Jérôme au 06 06 71 64 54', 'Jérôme GENDRON', 'jerome@vendez-votre-maison.fr', '06 06 71 64 54', '60240', 1, '49.2621619', '1.882324', 'Chaumont En Vexin', '60143', 'FRA', 1800, NULL, NULL, NULL, 0, 'V', 'simple', 1, 60000, 'EUR', 1, 61, NULL, NULL, 'https://fichiers.ubiflow.net/20/42/21/81/9/fresneaux-montchevreuiil-plan-division.pdf', NULL, NULL, NULL, NULL, 0),
(194, '1617', 'Terrain à bâtir', 'TERRAIN CONSTRUCTIBLE A VENDRE\nAxe Rapide N12 - 8 minutes de Dreux\nDans village paisible, beau terrain plat de 1100m² avec une façade de 18m.\nAssainissement individuel.\nSecteur ABF.\nLibre de constructeur.\nPrix : 55.000 €\nPour tout complément d\'informations, contactez Nelson au 06.34.14.08.50', 'Nelson FONSECA', 'nelson@vendez-votre-maison.fr', '06 34 14 08 50', '28500', 1, '48.728724', '1.262466', 'Boissy En Drouais', '28045', 'FRA', 1100, NULL, NULL, NULL, 0, 'V', 'simple', 1, 55000, 'EUR', 1, 29, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0);
