INSERT INTO `news` (`id`, `title`, `description`, `active`, `image_name`, `image_size`, `updated_at`, `homepage`) VALUES
(1, 'Comment vendre vite sa maison ou son appartement ?', '<p><strong>Vendre rapidement sa maison c&rsquo;est possible !</strong><br />\nVendez-votre-maison.fr vous permet d&rsquo;obtenir une offre d&rsquo;achat pour votre maison ou votre appartement en l&rsquo;&eacute;tat, en quelques clics et avec financement garanti. Sous r&eacute;serves de l&rsquo;exactitude des renseignements apport&eacute;s et de la visite de notre expert confirmant la valeur de l&rsquo;estimation.<br />\n&nbsp;<br />\nVendez-votre-maison.fr vous assure s&eacute;curit&eacute;, tranquillit&eacute; et rapidit&eacute; dans votre projet immobilier.<br />\n&nbsp;<br />\nSi vous voulez vendre vite, remplissez notre formulaire en ligne pour obtenir une offre interactive qui sera confirm&eacute;e par une visite des lieux.<br />\n&nbsp;<br />\n<strong>Quels types de biens achetons-nous&nbsp;?</strong><br />\nNous achetons tous types de biens immobiliers, maisons &agrave; r&eacute;nover, maisons avec travaux, pavillons anciens ou neufs, long&egrave;res, maisons de campagne, maisons anciennes &agrave; r&eacute;nover ou refaites, granges, terrains en lotissement, mais uniquement des terrains &agrave; b&acirc;tir ou des terrains agricoles en zone constructible.<br />\n&nbsp;<br />\nDes maisons modernes, contemporaines, des maisons en bois, des maisons individuelles, des maisons designs, des maisons bourgeoises, des villas, des&nbsp; ch&acirc;teaux...<br />\n&nbsp;<br />\nNous achetons &eacute;galement des appartements anciens ou r&eacute;cents.<br />\n&nbsp;<br />\n<strong>Quels avantages ai-je &agrave; vendre &agrave; Vendez-votre-maison.fr</strong><br />\nSi notre offre vous convient, cela vous permet de vendre imm&eacute;diatement -&nbsp;<strong>Une nouvelle vie commence.</strong><br />\n&nbsp;<br />\nFini les visites de particuliers qui ne savent pas ce qu&rsquo;ils cherchent. Votre nouveau projet peut commencer.<br />\n&nbsp;<br />\nFini la question de savoir &laquo;&nbsp;combien de temps pour trouver un acqu&eacute;reur&nbsp;?&nbsp;&raquo;<br />\nNous convenons ensemble de la date de r&eacute;alisation, en notre qualit&eacute; de marchand de biens, nous ne disposons pas de d&eacute;lai de r&eacute;tractation, la vente est d&eacute;finitive.<br />\n&nbsp;<br />\n<strong>Comment vous situez-vous par rapport au prix propos&eacute;&nbsp;?</strong><br />\nNous achetons pour revendre en notre qualit&eacute; de marchand de biens.<br />\n&nbsp;<br />\nEn toute transparence, nous vous indiquons le prix du march&eacute; et le prix auquel nous pouvons racheter votre maison.<br />\n&nbsp;<br />\nG&eacute;n&eacute;ralement en dessous du prix du march&eacute;, et parfois au-dessus selon son potentiel, ayant &eacute;galement le statut de promoteur immobilier.</p>', 1, '5cb5a57b3a41a_5caf2f0bde51b_5c772b3316234_iStock-898321776.jpg', 182700, '2019-04-16 11:50:51', 0),
(7, 'Immobilier : MyNotary et vendez-votre-maison.fr se rapprochent', '<p>Les jeunes pousses viennent de nouer un partenariat pour gagner en notori&eacute;t&eacute; sur le march&eacute; des maisons individuelles.</p>\r\n\r\n<div class=\"body-article\">\r\n<p>D&#39;une c&ocirc;t&eacute;, la soci&eacute;t&eacute; &agrave; responsabilit&eacute; limit&eacute;e (SARL) vendez-votre-maison.fr qui permet &agrave; tout vendeur d&#39;estimer son bien sur Internet avant qu&#39;un professionnel de l&#39;immobilier lui propose sous 48 heures une offre en bonne et due forme. De l&#39;autre, la startup MyNotary qui met &agrave; disposition une plateforme collaborative entre acqu&eacute;reurs, vendeurs, notaires, banques, assurances et agents. Les deux entreprises viennent en effet de signer un partenariat pour renforcer la transparence dans les transactions immobili&egrave;res.</p>\r\n\r\n<p><em>&quot;Il y a quelques mois, nous avons achet&eacute; une maison en Eure-et-Loire avant de signer le compromis de vente &agrave; distance via la plateforme. Cette transparence entre les diff&eacute;rentes parties nous a beaucoup plu&quot;,&nbsp;</em>raconte David Melo Pena, le pr&eacute;sident de vendez-votre-maison.fr.&nbsp;<em>&quot;Nous avons trouv&eacute; le concept tr&egrave;s int&eacute;ressant. C&#39;est particuli&egrave;rement utile pour acc&eacute;l&eacute;rer les processus d&#39;acquisition sur le march&eacute; d&eacute;tendu</em> (l&agrave; o&ugrave; l&#39;offre peut r&eacute;pondre &agrave; la demande, ndlr).&quot;,<em>&nbsp;</em>souligne le co-fondateur de MyNotary Sacha Boyer.</p>\r\n\r\n<p><a href=\"https://www.latribune.fr/entreprises-finance/industrie/biens-d-equipement-btp-immobilier/immobilier-mynotary-et-vendez-votre-maison-fr-se-rapprochent-810061.html\" target=\"_blank\">En savoir plus...</a></p>\r\n</div>', 1, '5caf2ed63a9a0_5c9b57d4847c2_La Tribune_03.JPG', 19954, '2019-04-11 14:11:02', 1),
(8, 'Pour conquérir les vendeurs, les iBuyers achètent les logements en 48 heures', '<p>Inspir&eacute;es du mod&egrave;le am&eacute;ricain, ces start-up ont d&eacute;barqu&eacute; en France en 2017. Si le service est prometteur, elles pourraient se heurter &agrave; la singularit&eacute; du march&eacute; de la pierre tricolore.</p>\r\n\r\n<div id=\"ctn_native_atf\">\r\n<div class=\"ba native_atf\" id=\"ba_native_atf\">&nbsp;</div>\r\n</div>\r\n\r\n<p>On n&#39;ach&egrave;te pas un bien immobilier comme on commande&nbsp;sur Amazon&hellip; mais nous n&#39;en sommes plus tr&egrave;s loin. En France, des plateformes immobili&egrave;res proposent d&eacute;sormais aux vendeurs d&#39;acqu&eacute;rir leur maison ou leur appartement sous 48&nbsp;heures. Leur nom&nbsp;: des iBuyers, qui une fois le bien acquis cherchent &agrave; le revendre au plus vite, pour minimiser les co&ucirc;ts d&#39;entretien (chauffage, &eacute;lectricit&eacute;, prorata de taxe fonci&egrave;re, etc.).</p>\r\n\r\n<p><a href=\"https://www.journaldunet.com/economie/immobilier/1421742-pour-conquerir-les-vendeurs-les-ibuyers-achetent-les-logements-en-48-heures/?fbclid=IwAR1i2qDYqZ7nu9GW_BJEXsiNoQxeLuczKPypMb3euRUzeZR1exZTJCGArPQ\" target=\"_blank\">En savoir plus...</a></p>\r\n\r\n<p>&nbsp;</p>', 1, '5caf2ecb66c2b_JDN 1.jpg', 23196, '2019-04-11 14:10:51', 1),
(9, 'vendez-votre-maison.fr : un nouveau partenaire pour les agences', '<p>Depuis juillet dernier, vendez-votre-maison.fr propose d&rsquo;acheter les biens des particuliers en 48 heures. Une solution simple, s&ucirc;re pour les vendeurs press&eacute;s, les h&eacute;ritiers, les familles recompos&eacute;es&hellip; Mais une opportunit&eacute; aussi pour les agences immobili&egrave;res. Comment &ccedil;a marche ?</p>\r\n\r\n<p>David Melo Pena a fait toute sa carri&egrave;re dans l&rsquo;immobilier. A 27 ans, en 2007, il cr&eacute;e In Vestiss France. La soci&eacute;t&eacute; exerce l&rsquo;activit&eacute; de marchand de biens, de promotion et de transactions immobili&egrave;res. Elle se d&eacute;veloppe et devient leader en Picardie avec 11 M&euro; de chiffre d&rsquo;affaires en 2017. D&eacute;but 2018, s&rsquo;inspirant du succ&egrave;s d&rsquo;une start-up californienne, Open Door, qui permet &laquo;&nbsp;&agrave; quiconque d&rsquo;acheter, de vendre ou d&rsquo;&eacute;changer une maison en un clic&raquo;, il se lance un nouveau challenge.</p>\r\n\r\n<p><a href=\"https://www.journaldelagence.com/1158957-vendez-votre-maison-un-nouveau-partenaire-pour-les-agences\" target=\"_blank\">En savoir plus...</a></p>\r\n\r\n<p>&nbsp;</p>', 1, '5caf2e9921256_Agence 1.jpg', 19697, '2019-04-11 14:10:01', 1);
