(22, 2, 8, '{\"input\":\"D\\u00e9crivez votre bien\",\"text\":\"Directement sur notre site et en quelques minutes seulement, vous permettez \\u00e0 un de nos experts d\'estimer votre bien \\u00e0 sa valeur la plus juste. Vous gardez le m\\u00eame interlocuteur durant toute la transaction.\",\"alt\":\"test\"}', '2019-04-16 11:17:38', 'Etape 1', 2, 12, '5cb59db263f92_5caf305229d46_andrew-neel-237802-unsplash.jpg', NULL),
