(28, 3, 2, '{\"text\":\"Vendez-votre-maison.fr se place comme une alternative \\u00e0 une vente traditionnelle. Nous avons cr\\u00e9\\u00e9 un processus de vente rapide et s\\u00e9curis\\u00e9. \\r\\nNotre service vous permet d\\u2019obtenir une vente ferme et sans r\\u00e9tractation. \\r\\nPour la premi\\u00e8re fois en France, est propos\\u00e9 un service d\\u2019estimation et d\\u2019offre de prix en ligne. \\r\\nNous avons choisi de rendre l\\u2019acte de vente facile. \\r\\nLeader sur ce march\\u00e9, d\\u00e9j\\u00e0 pr\\u00e8s de 600 biens ont \\u00e9t\\u00e9 achet\\u00e9s par nos \\u00e9quipes, repr\\u00e9sentant plus de 1600 transactions !\"}', NULL, 'Introduction', 1, 12, NULL, NULL),
(29, 3, 5, '{\"text\": \"Parce que les modèles de famille évoluent, parce que les nouvelles opportunités professionnelles se multiplient et parce que les occasions de changer de vie n\'ont jamais été si nombreuses, vendez-votre-maison.fr estime immédiatement votre maison et la rachète sous 48h, pour vous permettre de vous lancer immédiatement dans vos nouveaux projets.\", \"input\": \"Votre nouvelle vie commence maintenant.\"}', NULL, 'Votre nouvelle vie commence maintenant.', 3, 12, NULL, NULL),
