(41, 5, 8, '{\"input\":\"Nous achetons les biens de vos clients.\",\"text\":\"vendez-votre-maison.fr ach\\u00e8te pour vous des maisons, des appartements (vides ou lou\\u00e9s), des terrains \\u00e0 b\\u00e2tir, des ensembles immobiliers complets, et vous les propose ensuite \\u00e0 la revente lot par lot.\",\"alt\":null}', '2019-04-16 11:32:02', 'Bloc 1', 2, 12, '5cb5a111f41f8_5caf3655cecee_Rectangle-5.jpg', NULL),
(42, 5, 8, '{\"input\":\"Nous proposons une solution imm\\u00e9diate \\u00e0 vos clients.\",\"text\":\"Votre client a un projet d\\u2019achat de nouveau bien et doit vendre imm\\u00e9diatement sa maison ? Nous lui faisons une proposition sous 1 jour ouvr\\u00e9 \\u00e0 compter de la r\\u00e9ception de votre demande, et vous en confions ensuite la revente en exclusivit\\u00e9.\",\"alt\":null}', '2019-04-16 11:32:55', 'Bloc 2', 3, 12, '5cb5a147b99c0_5caf3660b80b9_Rectangle-5-copie.jpg', NULL),
(43, 5, 8, '{\"input\":\"Nous vous r\\u00e9compensons pour les biens que vous nous confiez.\",\"text\":\"Proposez des biens \\u00e0 vendez-votre-maison.fr, et entrez dans un programme relationnel exclusif et r\\u00e9mun\\u00e9rateur. Nous vous confions des biens en exclusivit\\u00e9 \\u00e0 la vente !\",\"alt\":null}', '2019-04-16 11:33:40', 'Bloc 3', 4, 12, '5cb5a174dcb17_5caf36868e685_Rectangle-5-copie2.jpg', NULL),
(44, 5, 8, '{\"input\":\"Nous vous aidons \\u00e0 s\\u00e9duire vos clients\",\"text\":\"Nous vous fournissons des photos r\\u00e9alis\\u00e9es par un photographe professionnel ainsi qu\'une visite virtuelle. Nos biens sont nettoy\\u00e9s \\u00e0 l\'int\\u00e9rieur comme \\u00e0 l\'ext\\u00e9rieur, le chauffage mis en marche selon les biens et la saison, pour que vos clients se sentent d\\u00e9j\\u00e0 comme chez eux.\",\"alt\":null}', '2019-04-16 11:34:30', 'Bloc 4', 5, 12, '5cb5a1a686585_5caf369ea6811_Rectangle-5-copie3.jpg', NULL),
