(52, 6, 5, '{\"input\":\"Quels sont les biens \\u00e9ligibles \\u00e0 l\\u2019offre ?\",\"text\":\"Tous types de biens, du terrain en passant par la grange jusqu\'\\u00e0 la maison, qu\'ils soient \\u00e0 r\\u00e9nover, \\u00e0 rafra\\u00eechir, en bon \\u00e9tat, ou neuf !\"}', NULL, 'Question 2', 2, 12, NULL, NULL),
(53, 6, 5, '{\"input\":\"Quelles sont les \\u00e9tapes de la vente ?\",\"text\":\"Etape 1 : d\\u00e9crivez votre bien.\\r\\nDirectement sur notre site et en quelques minutes seulement, vous permettez \\u00e0 un de nos experts d\'estimer votre bien \\u00e0 sa valeur la plus juste. Vous gardez le m\\u00eame interlocuteur durant toute la transaction.\\r\\n\\r\\nEtape 2 : recevez votre offre indicative.\\r\\nEn moins de 24h, nous vous communiquons une fourchette d\'estimation align\\u00e9e aux prix du march\\u00e9, ainsi qu\'une offre d\'achat indicative. Le processus de vente et nos frais vous sont expliqu\\u00e9s de mani\\u00e8re claire.\\r\\n\\r\\nEtape 3 : programmez une visite.\\r\\nC\'est vous qui d\\u00e9cidez du moment de cette visite gratuite d\'expertise. Contrairement \\u00e0 une vente classique, vous n\'avez pas \\u00e0 pr\\u00e9parer votre maison.\\r\\n\\r\\nEtape 4 : recevez votre offre ferme\\r\\n48h au plus tard apr\\u00e8s cette visite, nous vous faisons une offre d\'achat engageante, sans condition suspensive de financement.\\r\\n\\r\\nEtape 5 : signez \\u00e0 la date de votre choix.\\r\\nL\\u2019offre accept\\u00e9e, vous choisissez la date de vente qui vous convient le mieux. Vos projets changent ? Nous restons flexibles et \\u00e0 votre \\u00e9coute jusqu\'au dernier moment.\"}', NULL, 'Question 3', 3, 12, NULL, NULL),
