a dur&eacute;e de votre visite<\\/p>\\r\\n\\r\\n<p>(&quot;cookie de session&quot;) ou lors de plusieurs visites (&quot;cookie persistant&quot;). Les cookies peuvent avoir plusieurs r&ocirc;les mais<\\/p>\\r\\n\\r\\n<p>sont utilis&eacute;s sur notre site a des fins exclusivement d&#39;analyses statistiques et de gestion de trafic nous permettant, par<\\/p>\\r\\n\\r\\n<p>exemple, d&#39;am&eacute;liorer l&#39;ergonomie du site et l&#39;int&eacute;r&ecirc;t de nos services.<\\/p>\\r\\n\\r\\n<h4><strong>Information compl&eacute;mentaire sur les cookies :<\\/strong><\\/h4>\\r\\n\\r\\n<p>Pour une information compl&eacute;mentaire sur les cookies, vous pouvez visiter le site de la Commission Nationale<\\/p>\\r\\n\\r\\n<p>de l&#39;Informatique et des Libert&eacute;s (CNIL) : http:\\/\\/www.cnil.fr\\/vos-droits\\/vos-traces\\/les-cookies\\/<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<h3>&nbsp;<\\/h3>\"}', NULL, 'Mentions légales', 1, 12, NULL, NULL),
