INSERT INTO `sold` (`id`, `name`, `surface`, `room_count`, `description`, `contact_name`, `notation`, `image_name`, `image_size`, `updated_at`, `active`, `homepage`) VALUES
(1, 'PACY SUR EURE (27)', 24, 4, '<p>Maison, en plein coeur de Pacy sur Eure, comprenant chambre, salle d&#39;eau, coin cuisine, salon s&eacute;jour, sous-sol.</p>', 'Amandine', 5, '5cb5a66ad530f_5caf2f5023d73_5c90c1f4edc82_0.jpg', 113455, '2019-04-16 11:54:50', 1, 0),
(2, 'COURCELLES SUR SEINE (27)', 80, 3, '<p>Maison, 3 pi&egrave;ces &agrave;&nbsp;Courcelles sur Seine, &agrave; proximit&eacute; de Gaillon et de la gare d&#39;Aubevoye qui dessert Paris Gare Saint-Lazare en 57 min.</p>', 'Yannick', 5, '5cb5a6a1ce8ec_5caf2f59db187_5c90c34b0b7b5_01.jpg', 57168, '2019-04-16 11:55:45', 1, 1),
(3, 'ROQUEBRUNE S/ARGENS (83)', 78, 4, '<p>Appartement de type F4 au coeur de la Bouverie &agrave; Roquebrune sur Argens (83) comprenant cuisine am&eacute;nag&eacute;e ouverte sur salon de 30m&sup2; !</p>', 'Stéphane', 5, '5cb5a6d10448e_5caf2f63a23de_5c90f0a93cbf3_1.JPG', 292650, '2019-04-16 11:56:33', 1, 1),
(4, 'ST ETIENNE SOUS BAILLEUL (27)', 54, 4, '<p>Maison situ&eacute;e &agrave; Saint-Etienne sous Bailleul comprenant au rez-de-chauss&eacute;e sur&eacute;lev&eacute; un s&eacute;jour, une cuisine, une chambre et une salle de bains. Le sous-sol est am&eacute;nag&eacute; et comprend 2 chambres et 1 garage.</p>', 'Yannick', 5, '5cebe18b8b814_20160513_133813.jpg', 127678, '2019-05-27 15:09:31', 1, 0),
(5, 'GUISENIERS (27)', 73, 5, '<p>Maison comprenant au rez-de-chauss&eacute;e un s&eacute;jour, une cuisine, deux chambres, une salle d&rsquo;eau et wc, &agrave; l&rsquo;&eacute;tage une chambre et un grenier<br />\r\nam&eacute;nageable.</p>', 'Yannick', 5, '5cebe133e87b8_20170628_172554.jpg', 85045, '2019-05-27 15:08:03', 1, 0),
(6, 'MARCE (49)', 200, 9, '<p>Maison comprenant un sous-sol int&eacute;gral avec coin chaudi&egrave;re et adoucisseur d&rsquo;eau, WC et ancienne douche, puits et grange.<br />\r\nAu rez-de-chauss&eacute;e : entr&eacute;e, cuisine, bureau, salon- s&eacute;jour, WC, salle de bains, quatre pi&egrave;ces dont trois &agrave; destination de chambre et une ancienne cuisine. A l&rsquo;&eacute;tage : palier desservant cinq chambres, WC, pi&egrave;ce avec lavabo.</p>', 'Cédric', 5, '5caf2fb1b2911_5c91326014158_Marce facade1.JPG', 190805, '2019-04-11 14:14:41', 1, 0),
(7, 'BERTHENONVILLE (27)', 100, 5, '<p>Maison de plain-pied, comprenant un s&eacute;jour, une cuisine, une salle de bains, quatre chambres et un garage. Et un tr&egrave;s beau terrain plat de plus de 2700m&sup2;.</p>', 'Yannick', 5, '5cebe1dfb490f_20170504_145458.jpg', 201320, '2019-05-27 15:10:55', 1, 0),
(8, 'LES PONTS DE CE (49)', 84, 4, '<p>Maison comprenant une entr&eacute;e, un s&eacute;jour, une cuisine, 3 chambres, un wc et une salle de bains. Au sous-sol un garage, un atelier, un bureau et une buanderie.</p>', 'Cédric', 5, '5caf2fcd67e4d_5c9133952949e_Les Ponts de Cé_Maison_ext 3.jpg', 184914, '2019-04-11 14:15:09', 1, 0),
(9, 'MORTEAUX COULIBOEUF (14)', 280, 10, '<p>Grande maison bourgeoise comprenant une grande entr&eacute;e, salon, cuisine, salle &agrave; manger, au premier &eacute;tage 4 chambres et une salle de bains avec wc, au deuxi&egrave;me &eacute;tage 4 autres chambres, une salle d&#39;eau et un wc ind&eacute;pendant.</p>', 'Yannick', 5, '5caf2fde06b0d_5c9134d23814d_Morteaux Couliboeuf_ext2.jpg', 101864, '2019-04-11 14:15:26', 1, 0),
(10, 'BEAUVAIS (60)', 91, 3, '<p>Quartier du Thil</p>', 'Jérôme', 5, '5cebe0d05d724_P1090921.JPG', 987983, '2019-05-27 15:06:24', 1, 0),
(11, 'CATENOY (60)', 190, 6, '<p>Ensemble de 2 habitations + 2 granges</p>', 'Peggy', 5, '5caf2ff75a127_5c9a38f68f768_DSCN4590.JPG', 95999, '2019-04-11 14:15:51', 1, 0),
(12, 'CATILLON FUMECHON (60)', 65, 3, '<p>Maison &agrave; Catillon (60) comprenant une entr&eacute;e sur un salon s&eacute;jour, WC, salle d&rsquo;eau, bureau, 2 chambres.</p>', 'Jérôme', 5, '5cebe3b8440d9_Maison 1.JPG', 224425, '2019-05-27 15:18:48', 1, 0),
(13, 'BEZU SAINT-ELOI (27)', 65, 3, '<p>Maison sur sous-sol total !</p>', 'Florence', 5, '5cfa5fd8eb2ad_Bezu3_maison.jpg', 141195, '2019-06-07 15:00:08', 1, 0),
(14, 'LA NEUVE GRANGE (27)', 69, 4, '<p>Maison avec un grand s&eacute;jour, une cuisine, 2 chambres, salle d&#39;eau et wc + buanderie et garage.</p>', 'Florence', 5, '5cfa61254fbf0_La Neuve Grange_maison.jpg', 138429, '2019-06-07 15:05:41', 1, 0),
(15, 'CORNILLE LES CAVES (49)', 150, 6, '<p>Maison sur sous-sol comprenant 5 chambres !</p>', 'Cédric', 5, '5cfa646ab6afc_Cornille les Caves_maison.JPG', 95199, '2019-06-07 15:19:38', 1, 0),
(16, 'BREUIL LE VERT (60)', 81, 4, '<p>Beau pavillon comprenant 3 chambres, avec sous-sol</p>', 'Déborah', 5, '5cfa6b051e0b8_Breuil le Vert_maison.jpg', 134017, '2019-06-07 15:47:49', 1, 0),
(17, 'DRESLINCOURT (60)', 65, 3, '<p>Pavillon des ann&eacute;es 1960 comprenant 2 chambres.</p>', 'Aurélie', 5, '5cfa6d266a540_Dreslincourt Picardie_maison.jpg', 110050, '2019-06-07 15:56:54', 1, 0),
(18, 'VILLERS-COTTERETS (02)', 41, 3, '<p>Bel appartement de 41 m&sup2; en duplex offrant salon avec cuisine ouverte &eacute;quip&eacute;e, 2 chambres, salle de bains.<br />\r\nDans une petite copropri&eacute;t&eacute;, avec de tr&egrave;s faibles charges (environ 150 euros/an)<br />\r\nLe plus de l&#39;appartement : une grande cave !</p>', 'Alexandre', 5, '5cfa6e38591a5_Villers cotterets_Bapaume.jpg', 106978, '2019-06-07 16:01:28', 1, 0),
(19, 'DREUX (28)', 69, 4, '<p>Grand s&eacute;jour/salon et 2 chambres &agrave; l&#39;&eacute;tage pour cette ancienne maison et comprenant un garage !</p>', 'Nelson', 5, '5cfa6fb230a4d_Dreux_Bonnet.jpg', 168109, '2019-06-07 16:07:46', 1, 0),
(20, 'ST REMY S/AVRE (28)', 65, 4, '<p>Pavillon sur sous-sol total comprenant une entr&eacute;e, une cuisine, un salon avec chemin&eacute;e, une v&eacute;randa, trois chambres, une salle de bains, wc. Etage : grenier am&eacute;nageable</p>', 'Nelson', 5, '5cfa72eae37ae_St Rémy Plessis_maison.jpg', 130422, '2019-06-07 16:21:30', 1, 0),
(21, 'TILLY (78)', 200, 7, '<p>Une maison de 7 Pi&egrave;ces principales d&rsquo;une surface d&rsquo;environ 200 m&sup2; et d&rsquo;un garage d&rsquo;une surface d&rsquo;environ 30m&sup2; accompagn&eacute;e d&rsquo;une d&eacute;pendance d&rsquo;une surface d&rsquo;environ 150 m&sup2;</p>', 'Vincent', 5, '5cfa73d95f0a7_Tilly_maison.jpg', 134907, '2019-06-07 16:25:29', 1, 0),
(22, 'BENERVILLE (14)', 32, 1, '<p>B&eacute;nerville sur Mer (14), studio de 31m&sup2; en rez-de-jardin + cave et jardin privatif de 200m&sup2; avec vue sur mer !</p>', 'Florence', 5, '5d038aef09754_Benerville.jpg', 164365, '2019-06-14 13:54:23', 1, 1),
(23, 'NEAUFLES ST MARTIN (27)', 95, 5, '<p>Neaufles Saint-Martin (27), maison individuelle T5 de 95m&sup2; avec garage.</p>', 'Amandine', 5, '5d038d603eab0_Neaufles St Martin.jpg', 118619, '2019-06-14 14:04:48', 1, 0),
(24, 'AMIENS (80)', 90, 5, '<p>Maison T5 avec garage au coeur d&#39;Amiens de pr&egrave;s de 90m&sup2;.</p>', 'Séverine', 5, '5d038e540d9c7_Amiens_Assas.jpg', 110795, '2019-06-14 14:08:52', 1, 0),
(25, 'CHATEAUNEUF D\'ILLE ET VILAINE (35)', 85, 5, '<p>Maison T5 avec garage situ&eacute;e &agrave; CHATEAUNEUF D&#39;ILLE ET VILAINE (35)</p>', 'Cédric', 5, '5d03901d36073_Chateauneuf.JPG', 150738, '2019-06-14 14:16:29', 1, 0),
(26, 'TREILLIERES (44)', 125, 5, '<p>Maison individuelle situ&eacute;e &agrave; TREILLIERES (44)</p>', 'Cédric', 5, '5d0392d30a3f6_Treillières.JPG', 101069, '2019-06-14 14:28:03', 1, 0),
(27, 'BALLANCOURT SUR ESSONNE (91)', 77, 9, '<p>Maison individuelle de plain-pied situ&eacute;e &agrave; BALLANCOURT SUR ESSONNE (91)</p>', 'Maxime', 5, '5d0393cbe40a8_Ballancourt.jpg', 115091, '2019-06-14 14:32:11', 1, 0),
(28, 'LE LUC (83)', 64, 3, '<p>&nbsp;LE LUC (83340) - MAISON AVEC GARAGE dans quartier r&eacute;sidentiel &agrave; proximit&eacute; de tous commerces et &eacute;cole, au calme, Jolie maison de pr&egrave;s de 65m&sup2; offrant au rez-de-chauss&eacute;e, entr&eacute;e avec rangement, cuisine am&eacute;nag&eacute;e, salle &agrave; manger/s&eacute;jour, cellier/buanderie. A l&#39;&eacute;tage : palier desservant salle de bains, WC ind&eacute;pendant et 2 belles chambres dont 1 avec placards. 2 jardinets clos. Garage attenant.</p>', 'Stéphane', 5, '5d0394f8901e2_Le Luc_vendus.JPG', 158570, '2019-06-14 14:37:12', 1, 0),
(29, 'BACQUEVILLE (27)', 98, 5, '<p>Maison individuelle T5 situ&eacute;e &agrave; BACQUEVILLE (27), de plain-pied comprenant un s&eacute;jour double donnant sur une cuisine ouverte, 4 chambres, salle de bains, wc. Garage. Le tout sur environ 1000 m&sup2; de jardin</p>', 'Yannick', 5, '5d03983f56370_Bacqueville.JPG', 97947, '2019-06-14 14:51:11', 1, 0),
(30, 'CREIL (60)', 70, 4, '<p>A CREIL, maison de ville mitoyenne &agrave; r&eacute;nover totalement, sur cave, comprenant au rez-de-chauss&eacute;e : entr&eacute;e sur cuisine, salon, wc ; &agrave; l&#39;&eacute;tage : salle d&#39;eau, une chambre, cuisine et salle &agrave; manger ; au deuxi&egrave;me &eacute;tage : grenier dont l&#39;acc&egrave;s se fait par un escalier escamotable.<br />\r\nJardin en pente avec plusieurs d&eacute;pendances et garages.</p>', 'Déborah', 4, '5d03b5d112e66_Creil_Vaux.jpg', 202799, '2019-06-14 16:57:21', 1, 0),
(31, 'BEZU SAINT-ELOI (27)', 65, 3, '<p>Maison sur sous-sol total situ&eacute;e &agrave; BEZU SAINT-ELOI</p>', 'Florence', 5, '5d1219982cd83_Bezu1_maison.jpg', 128572, '2019-06-25 14:54:48', 1, 0),
(32, 'CORMEILLES EN PARISIS (95)', 43, 2, '<p>Appartement &agrave; CORMIELLES EN PARISIS (95) situ&eacute; au 4&egrave;me &eacute;tage avec cuisine ind&eacute;pendante et grand s&eacute;jour de 19m&sup2;</p>', 'Florence', 5, '5d121a7faa1d3_Cormeilles en Parisis.JPG', 135183, '2019-06-25 14:58:39', 1, 0),
(33, 'DEAUVILLE (14)', 35, 2, '<p>F2 situ&eacute; sur le Port Blue Bay de DEAUVILLE !</p>', 'Amandine', 5, '5d121baf281d4_Deauville_BlueBay.jpg', 119936, '2019-06-25 15:03:43', 1, 0),
(34, 'SERIFONTAINE (60)', 85, 3, '<p>Pavillon situ&eacute; &agrave; S&eacute;rifontaine (60)</p>', 'Florence', 5, '5d121ce4148d0_Sérifontaine_1.jpg', 121869, '2019-06-25 15:08:52', 1, 0),
